                "Pricing-amountReceived-card-1": "<p>HostnFly vous assure un <strong>budget suppl\xe9mentaire<strong> pour vos d\xe9placements, week-ends, vacances</p>",
                "Pricing-amountReceived-card-2": "<p>HostnFly vous verse ce revenu \xe0 la fin de la location, ce qui vous permet de <strong>compl\xe9ter vos revenus</strong></p>",
                "Pricing-Commision-card-1": "<p>Le revenu que nous vous <strong>garantissons</strong> correspond \xe0 <strong>la moyenne du march\xe9,</strong> pour des logements avec des caract\xe9ristiques (adresse, taille, capacit\xe9, etc.) similaires aux v\xf4tres. <strong>Nous tenterons de g\xe9n\xe9rer plus d\u2019argent que le revenu qui vous a \xe9t\xe9 garanti et nous r\xe9mun\xe8rerons si nous y arrivons.</stong></p>",
                "Pricing-Commision-card-2": "<p>Nous prenons une <strong>commission</strong> sur les r\xe9servations. <strong>Entre 15% et 25%,</strong> en fonction du nombre de nuits cons\xe9cutives confi\xe9es :</p><ul class='list-no-points'><li><strong>25%</strong><span>7 nuits ou moins</span></li><li><strong>20%</strong><span>Entre 8 et 30 nuits</span></li><li><strong>18%</strong><span>Entre 1 et 6 mois</span></li><li><strong>15%</strong><span>Biens commerciaux lou\xe9s \xe0 l\u2019ann\xe9e</span></li></ul>",
                "Pricing-Review-card-1": "<i>\xab\xa0HostnFly a lou\xe9 mon appart pendant un long week-end au ski l\u2019ann\xe9e derni\xe8re : j\u2019ai re\xe7u mon revenu garanti de 153\u20ac au d\xe9but de mes 3 jours de location. Du coup, j\u2019ai pu financer une partie de mon s\xe9jour !\xa0\xbb</i>",
                "Pricing-Review-card-2": "<i>\xab Apr\xe8s quelques locations en revenu garanti, j'ai accumul\xe9 de nombreux commentaires positifs sur mon annonce et j'ai obtenu le statut de SuperHost, ce qui a fait grimper l'attractivit\xe9 de mon appart. Je choisis d\xe9sormais le revenu r\xe9el qui me permet de g\xe9n\xe9rer une belle rentabilit\xe9. La derni\xe8re fois, j'ai re\xe7u 80% des 1650\u20ac g\xe9n\xe9r\xe9s par 3 semaines de location, soit 1320\u20ac apr\xe8s d\xe9duction de la commission.\xa0\xbb</i>",
                "Pricing-ReviewIdentity-card-1": "Julie, propri\xe9taire T2 dans le 17\xe8me",
                "Pricing-ReviewIdentity-card-2": "Romain, locataire T2 dans le 9\xe8me",
                "Pricing-goodToKnow": "<p><strong>Bon \xe0 savoir :</strong> votre choix entre le revenu garanti et le revenu r\xe9el se fera uniquement apr\xe8s la signature de votre contrat HostnFly, directement depuis votre espace personnel</p>",
                "Pricing-doWeEarn": "Comment HostnFly se r\xe9mun\xe8re ?",
