    e.exports = "#### 1. D\xe9finition et nature des donn\xe9es \xe0 caract\xe8re personnel\n\nLors de votre utilisation du site Hostnfly.com (ci-apr\xe8s: le \xabSite\xbb), nous pouvons \xeatre amen\xe9s \xe0 vous demander de nous communiquer des donn\xe9es \xe0 caract\xe8re personnel vous concernant, afin d\u2019utiliser nos services (ci-apr\xe8s, les \xab Services \xbb).\n\nLe terme \xabdonn\xe9es \xe0 caract\xe8re personnel\xbb d\xe9signe toutes les donn\xe9es qui permettent d\u2019identifier un individu, ce qui correspond notamment \xe0 vos nom, pr\xe9noms, pseudonyme, photographie, adresses postale et de courrier \xe9lectronique, num\xe9ros de t\xe9l\xe9phone, date de naissance, donn\xe9es relatives \xe0 vos transactions sur le Site, d\xe9tails de vos achats et abonnements, informations de facturation, informations sur votre logement, informations relatives \xe0 votre annonce de location, ainsi qu\u2019\xe0 tout autre renseignement que vous choisirez de nous communiquer \xe0 votre sujet.\n\n#### 2. Objet de la pr\xe9sente charte\n\nLa pr\xe9sente charte a pour objet de vous informer sur les moyens que nous mettons en \u0153uvre pour collecter et traiter vos donn\xe9es \xe0 caract\xe8re personnel, dans le respect le plus strict de vos droits.\n\nNous vous indiquons \xe0 ce sujet que nous nous conformons, dans la collecte et la gestion de vos donn\xe9es \xe0 caract\xe8re personnel, \xe0 la loi n\xb0 78-17 du 6 janvier 1978 relative \xe0 l'informatique, aux fichiers et aux libert\xe9s, dans sa version actuelle (ci-apr\xe8s : la \xab Loi Informatique et Libert\xe9s \xbb), ainsi que le r\xe8glement (UE) 2016/679 du 27 avril 2016 relatif \xe0 la protection des personnes physiques \xe0 l'\xe9gard du traitement des donn\xe9es \xe0 caract\xe8re personnel et \xe0 la libre circulation de ces donn\xe9es (ci-apr\xe8s : le \xab RGPD \xbb).\n\n#### 3. Identit\xe9 du responsable de la collecte et du traitement de donn\xe9es\n\nLe responsable de la collecte et du traitement de vos donn\xe9es \xe0 caract\xe8re personnel est la soci\xe9t\xe9 HOSTNFLY, soci\xe9t\xe9 par actions simplifi\xe9e, immatricul\xe9e au Registre du Commerce et des Soci\xe9t\xe9s de Paris sous le n\xb0 819 675 885, ayant son si\xe8ge social 6, rue de Calais - 75009 Paris (d\xe9nomm\xe9e dans le cadre des pr\xe9sentes : \xabNous\xbb).\n\n#### 4. Collecte et traitement des donn\xe9es \xe0 caract\xe8re personnel\n\nLe fondement l\xe9gal de notre collecte de vos donn\xe9es personnelles est le suivant :\n\n(i) L\u2019int\xe9r\xeat l\xe9gitime lorsque vous nous fournissez volontairement des donn\xe9es \xe0 caract\xe8re personnel lors de votre visite sur notre Site, les donn\xe9es \xe9tant alors collect\xe9es pour nous permettre de mieux r\xe9pondre \xe0 vos demandes d\u2019information sur nos Services.\n\n(ii) Votre consentement s\u2019agissant des cookies de r\xe9seaux sociaux, des cookies publicitaires et des cookies analytics vis\xe9s \xe0 l\u2019article 10, ou de l\u2019envoi d\u2019informations et prospections\n\n(iii) cette collecte est n\xe9cessaire afin d\u2019ex\xe9cuter le contrat conclu lorsque vous utilisez nos Services sur notre Site.\n\n(iv) Lorsque le traitement de vos donn\xe9es est n\xe9cessaire au respect d\u2019une obligation l\xe9gale \xe0 laquelle nous sommes soumis\n\nVos donn\xe9es \xe0 caract\xe8re personnel sont collect\xe9es et trait\xe9es pour r\xe9pondre \xe0 une ou plusieurs des finalit\xe9s suivantes : 1. G\xe9rer votre acc\xe8s \xe0 nos services accessibles sur le Site et leur utilisation, 2. Effectuer les op\xe9rations relatives \xe0 la gestion des clients concernant les contrats, factures, programmes de fid\xe9lit\xe9, suivis de la relation avec les clients, 3. Constituer un fichier de membres inscrits, d\u2019utilisateurs, de clients et prospects, 4. Adresser des newsletters, sollicitations et messages promotionnels. Dans le cas o\xf9 vous ne le souhaiteriez pas, nous vous donnons la facult\xe9 d\u2019exprimer votre refus \xe0 ce sujet lors de la collecte de vos donn\xe9es; 5. \xc9laborer des statistiques commerciales et de fr\xe9quentation de nos services, 6. Organiser des jeux concours, loteries et toutes op\xe9rations promotionnelles \xe0 l\u2019exclusion des jeux d\u2019argent et de hasard en ligne soumis \xe0 l\u2019agr\xe9ment de l\u2019Autorit\xe9 de R\xe9gulation des Jeux en ligne, 7. G\xe9rer la gestion des avis des personnes sur des produits, services ou contenus, 8. G\xe9rer les impay\xe9s et les contentieux \xe9ventuels quant \xe0 l\u2019utilisation de nos produits et services, 9. Respecter nos obligations l\xe9gales et r\xe9glementaires, 10. Personnaliser les r\xe9ponses \xe0 vos demandes d\u2019informations.\n\nNous vous informons, lors de la collecte de vos donn\xe9es personnelles, si certaines donn\xe9es doivent \xeatre obligatoirement renseign\xe9es ou si elles sont facultatives. Les donn\xe9es obligatoires sont n\xe9cessaires pour le fonctionnement des Services. Concernant les donn\xe9es facultatives, vous \xeates enti\xe8rement libre de les indiquer ou non. Nous vous indiquons \xe9galement quelles sont les cons\xe9quences \xe9ventuelles d\u2019un d\xe9faut de r\xe9ponse.\n\n#### 5. Destinataires des donn\xe9es collect\xe9es et trait\xe9es\n\nSeul le personnel de notre soci\xe9t\xe9, les services charg\xe9s du contr\xf4le (commissaire aux comptes notamment) et nos sous-traitants auront acc\xe8s \xe0 vos donn\xe9es \xe0 caract\xe8re personnel.\n\nPeuvent \xe9galement \xeatre destinataires de vos donn\xe9es \xe0 caract\xe8re personnel les organismes publics, exclusivement pour r\xe9pondre \xe0 nos obligations l\xe9gales, les auxiliaires de justice, les officiers minist\xe9riels et les organismes charg\xe9s d\u2019effectuer le recouvrement de cr\xe9ances.\n\n#### 6. Cession des donn\xe9es \xe0 caract\xe8re personnel\n\nVos donn\xe9es \xe0 caract\xe8re personnel ne feront pas l\u2019objet de cessions, locations ou \xe9changes au b\xe9n\xe9fice de tiers.\n\n#### 7. Dur\xe9e de conservation des donn\xe9es \xe0 caract\xe8re personnel\n(i) Concernant les donn\xe9es relatives \xe0 la gestion de clients et prospects : Vos donn\xe9es \xe0 caract\xe8re personnel ne seront pas conserv\xe9es au-del\xe0 de la dur\xe9e strictement n\xe9cessaire \xe0 la gestion de notre relation commerciale avec vous. Toutefois, les donn\xe9es permettant d\u2019\xe9tablir la preuve d\u2019un droit ou d\u2019un contrat, devant \xeatre conserv\xe9es au titre du respect d\u2019une obligation l\xe9gale, le seront pendant la dur\xe9e pr\xe9vue par la loi en vigueur.\n\nConcernant d\u2019\xe9ventuelles op\xe9rations de prospection \xe0 destination des clients, leurs donn\xe9es pourront \xeatre conserv\xe9es pendant un d\xe9lai de trois (3) ans \xe0 compter de la fin de la relation commerciale.\n\nLes donn\xe9es \xe0 caract\xe8re personnel relatives \xe0 un prospect, non client, pourront \xeatre conserv\xe9es pendant un d\xe9lai de trois (3) ans \xe0 compter de leur collecte ou du dernier contact \xe9manant du prospect.\n\nAu terme de ce d\xe9lai de trois (3) ans, nous pourrons reprendre contact avec vous pour savoir si vous souhaitez continuer \xe0 recevoir des sollicitations commerciales.\n\n(ii) Concernant les pi\xe8ces d\u2019identit\xe9 : En cas d\u2019exercice du droit d\u2019acc\xe8s ou de rectification, les donn\xe9es relatives aux pi\xe8ces d\u2019identit\xe9 pourront \xeatre conserv\xe9es pendant le d\xe9lai pr\xe9vu \xe0 l\u2019article 9 du code de proc\xe9dure p\xe9nale, soit un an. En cas d\u2019exercice du droit d\u2019opposition, ces donn\xe9es peuvent \xeatre archiv\xe9es pendant le d\xe9lai de prescription pr\xe9vu par l\u2019article 8 du code de proc\xe9dure p\xe9nale, soit trois (3) ans.\n\n(iii) Concernant les donn\xe9es relatives aux cartes bancaires : Les transactions financi\xe8res relatives au paiement des achats et des frais via le Site, sont confi\xe9es \xe0 un prestataire de services de paiement qui en assure le bon d\xe9roulement et la s\xe9curit\xe9.\n\nPour les besoins des services, ce prestataire de services de paiement peut \xeatre amen\xe9 \xe0 \xeatre destinataire de vos donn\xe9es \xe0 caract\xe8re personnel relatives \xe0 vos num\xe9ros de cartes bancaires, qu\u2019il recueille et conserve en notre nom et pour notre compte.\n\nNous n\u2019avons pas acc\xe8s \xe0 ces donn\xe9es.\n\nPour vous permettre de r\xe9aliser r\xe9guli\xe8rement des achats ou de r\xe9gler les frais aff\xe9rents sur le Site, vos donn\xe9es relatives \xe0 vos cartes bancaires sont conserv\xe9es pendant le temps de votre inscription sur le Site et \xe0 tout le moins, jusqu\u2019au moment o\xf9 vous r\xe9alisez votre derni\xe8re transaction.\n\nEn ayant coch\xe9 sur le Site la case express\xe9ment pr\xe9vue \xe0 cet effet, vous nous donnez votre consentement expr\xe8s pour cette conservation.\nLes donn\xe9es relatives au cryptogramme visuel ou CVV2, inscrit sur votre carte bancaire, ne sont pas stock\xe9es.\n\nSi vous refusez que vos donn\xe9es \xe0 caract\xe8re personnel relatives \xe0 vos num\xe9ros de cartes bancaires soient conserv\xe9es dans les conditions pr\xe9cis\xe9es ci-dessus, nous ne conserverons pas ces donn\xe9es au-del\xe0 du temps n\xe9cessaire pour permettre la r\xe9alisation de la transaction.\n\nEn tout \xe9tat de cause, les donn\xe9es relatives \xe0 celles-ci pourront \xeatre conserv\xe9es, pour une finalit\xe9 de preuve en cas d\u2019\xe9ventuelle contestation de la transaction, en archives interm\xe9diaires, pour la dur\xe9e pr\xe9vue par l\u2019article L 133-24 du Code mon\xe9taire et financier, en l\u2019occurrence treize (13) mois suivant la date de d\xe9bit. Ce d\xe9lai peut \xeatre \xe9tendu \xe0 quinze (15) mois afin de prendre en compte la possibilit\xe9 d\u2019utilisation des cartes de paiement \xe0 d\xe9bit diff\xe9r\xe9.\n\n(iv) Concernant la gestion des listes d\u2019opposition \xe0 recevoir de la prospection : Les informations permettant de prendre en compte votre droit d\u2019opposition sont conserv\xe9es au minimum trois (3) ans \xe0 compter de l\u2019exercice du droit d\u2019opposition.\n\n(v) Concernant les statistiques de mesure d\u2019audience : Les informations stock\xe9es dans le terminal des utilisateurs ou tout autre \xe9l\xe9ment utilis\xe9 pour identifier les utilisateurs et permettant leur tra\xe7abilit\xe9 ou fr\xe9quentation ne seront pas conserv\xe9es au-del\xe0 de six (6) mois.\n\n(vi) Concernant les cookies :\n\nLa dur\xe9e de conservation des cookies vis\xe9s \xe0 l\u2019article 10 est de 13 (treize) mois.\n\n#### 8. S\xe9curit\xe9\nNous vous informons prendre toutes pr\xe9cautions utiles, mesures organisationnelles et techniques appropri\xe9es pour pr\xe9server la s\xe9curit\xe9, l\u2019int\xe9grit\xe9 et la confidentialit\xe9 de vos donn\xe9es \xe0 caract\xe8re personnel et notamment, emp\xeacher qu\u2019elles soient d\xe9form\xe9es, endommag\xe9es ou que des tiers non autoris\xe9s y aient acc\xe8s. Nous recourrons \xe9galement \xe0 des syst\xe8mes de paiement s\xe9curis\xe9 conformes \xe0 l\u2019\xe9tat de l\u2019art et \xe0 la r\xe9glementation applicable.\n\n#### 9. H\xe9bergement\nNous vous informons que vos donn\xe9es sont conserv\xe9es et stock\xe9es, pendant toute la dur\xe9e de leur conservation sur les serveurs de les soci\xe9t\xe9s AWS et Heroku, situ\xe9s en Ireland, France et Allemagne dans l\u2019Union europ\xe9enne.\n\nVos donn\xe9es ne feront l\u2019objet d\u2019aucun transfert en dehors de l\u2019Union europ\xe9enne dans le cadre de l\u2019utilisation des services que nous vous proposons.\n\n#### 10. Cookies\nLes cookies sont des fichiers textes, souvent crypt\xe9s, stock\xe9s dans votre navigateur. Ils sont cr\xe9\xe9s lorsque le navigateur d\u2019un utilisateur charge un site internet donn\xe9 : le site envoie des informations au navigateur, qui cr\xe9\xe9 alors un fichier texte. Chaque fois que l\u2019utilisateur revient sur le m\xeame site, le navigateur r\xe9cup\xe8re ce fichier et l\u2019envoie au serveur du site internet.\n\nOn peut distinguer diff\xe9rents types de cookies, qui n\u2019ont pas les m\xeames finalit\xe9s :\n\n - Les cookies techniques sont utilis\xe9s tout au long de votre navigation, afin de la faciliter et d\u2019ex\xe9cuter certaines fonctions. Un cookie technique peut par exemple \xeatre utilis\xe9 pour m\xe9moriser les r\xe9ponses renseign\xe9es dans un formulaire ou encore les pr\xe9f\xe9rences de l\u2019utilisateur s\u2019agissant de la langue ou de la pr\xe9sentation d\u2019un site internet, lorsque de telles options sont disponibles.\n\nNous utilisons des cookies techniques.\n\n - Les cookies des r\xe9seaux sociaux peuvent \xeatre cr\xe9\xe9s par les plateformes sociales pour permettre aux concepteurs de sites internet de partager le contenu de leur site sur lesdites plateformes. Ces cookies peuvent notamment \xeatre utilis\xe9s par les plateformes sociales pour tracer la navigation des internautes sur le site internet concern\xe9, qu\u2019ils utilisent ou non ces cookies.\n\nNous utilisons des cookies des r\xe9seaux sociaux (notamment Facebook et Pinterest).\n\nNous vous invitons par ailleurs \xe0 consulter les politiques de protection de la vie priv\xe9e des plateformes sociales \xe0 l\u2019origine de ces cookies, pour prendre connaissance des finalit\xe9s d\u2019utilisation des informations de navigation qu\u2019elles peuvent recueillir gr\xe2ce \xe0 ces cookies et des modalit\xe9s d\u2019exercice de vos droits aupr\xe8s de ces plateformes.\n\n - Les cookies publicitaires peuvent \xeatre cr\xe9\xe9s non seulement par le site internet sur lequel l\u2019utilisateur navigue, mais \xe9galement par d\u2019autres sites internet diffusant des publicit\xe9s, annonces, widgets ou autres \xe9l\xe9ments sur la page affich\xe9e. Ces cookies peuvent notamment \xeatre utilis\xe9s pour effectuer de la publicit\xe9 cibl\xe9e, c\u2019est-\xe0-dire de la publicit\xe9 d\xe9termin\xe9e en fonction de la navigation de l\u2019utilisateur.\n\nNous n\u2019utilisons pas de cookies publicitaires. Toutefois, si nous devions en utiliser \xe0 l\u2019avenir, nous vous en informerions au pr\xe9alable et vous auriez la possibilit\xe9 le cas \xe9ch\xe9ant de d\xe9sactiver ces cookies.\n\nNous utilisons des outils analytics (notamment Hotjar, Google Analytics, Segment, Amplitude) qui sont des outils statistiques d\u2019analyse d\u2019audience qui g\xe9n\xe8rent un cookie permettant de mesurer le nombre de visites sur le Site, le nombre de pages vues et l\u2019activit\xe9 des visiteurs. Votre adresse IP est \xe9galement collect\xe9e pour d\xe9terminer la ville depuis laquelle vous vous connectez.\n\nNous vous rappelons \xe0 toutes fins utiles qu\u2019il vous est possible de vous opposer au d\xe9p\xf4t de cookies en configurant votre navigateur. Un tel refus pourrait toutefois emp\xeacher le bon fonctionnement du Site.\n\n#### 11. Acc\xe8s \xe0 vos donn\xe9es \xe0 caract\xe8re personnel\n\nConform\xe9ment \xe0 la loi n\xb078-17 du 6 janvier 1978 relative \xe0 l'informatique, aux fichiers et aux libert\xe9s, et au RGPD, vous disposez du droit d\u2019obtenir la communication et, le cas \xe9ch\xe9ant, la rectification ou la suppression des donn\xe9es vous concernant. Vous pouvez \xe9galement vous adresser \xe0 :\n - adresse de courrier \xe9lectronique : contact@hostnfly.com\n - adresse de courrier postal : 71 rue r\xe9aumur, 75003, Paris\n\nIl est rappel\xe9 que toute personne peut, pour des motifs l\xe9gitimes, s'opposer au traitement des donn\xe9es la concernant.\n\n#### 12. Droit de rectification\n\nVous avez le droit de rectifier \xe0 tout moment vos donn\xe9es \xe0 caract\xe8re personnel inexactes, incompl\xe8tes ou obsol\xe8tes\n\n#### 13. Droit \xe0 l\u2019oubli\n\nVous avez le droit d\u2019exiger que vos donn\xe9es \xe0 caract\xe8re personnel soient effac\xe9es, et d\u2019en interdire toute collecte future.\n\n#### 14. Droit d\u2019opposition\n\nVous avez le droit de vous opposer au traitement de vos donn\xe9es \xe0 caract\xe8re personnel. Notez toutefois que nous pourrons maintenir leur traitement malgr\xe9 cette opposition, pour des motifs l\xe9gitimes ou la d\xe9fense de droits en justice.\n\nS\u2019agissant de la prospection, vous pouvez vous y opposer \xe0 tout moment via le lien de d\xe9sinscription situ\xe9 au bas de chacun de nos emails de prospection.\n\n#### 15. Droit de d\xe9finir des directives relatives au traitement des donn\xe9es apr\xe8s votre mort\n\nVous disposez du droit de d\xe9finir des directives relatives \xe0 la conservation, \xe0 l'effacement et \xe0 la communication de vos donn\xe9es \xe0 caract\xe8re personnel apr\xe8s votre mort.\n\nCes directives peuvent \xeatre g\xe9n\xe9rales, c\u2019est-\xe0-dire qu\u2019elles portent alors sur l\u2019ensemble des donn\xe9es \xe0 caract\xe8re personnel qui vous concernent. Elles doivent dans ce cas \xeatre enregistr\xe9es aupr\xe8s d\u2019un tiers de confiance num\xe9rique certifi\xe9 par la CNIL.\n\nLes directives peuvent aussi \xeatre sp\xe9cifiques aux donn\xe9es trait\xe9es par notre soci\xe9t\xe9. Il convient alors de nous les transmettre aux coordonn\xe9es suivantes :\n - adresse de courrier \xe9lectronique : contact@hostnfly.com\n - adresse de courrier postal : 6 rue de Calais, 75009, Paris\n\nEn nous transmettant de telles directives, vous donnez express\xe9ment votre consentement pour que ces directives soient conserv\xe9es, transmises et ex\xe9cut\xe9es selon les modalit\xe9s pr\xe9vues aux pr\xe9sentes.\n\nVous pouvez d\xe9signer dans vos directives une personne charg\xe9e de leur ex\xe9cution. Celle-ci aura alors qualit\xe9, lorsque vous serez d\xe9c\xe9d\xe9(e), pour prendre connaissance desdites directives et nous demander leur mise en \u0153uvre. A d\xe9faut de d\xe9signation vos h\xe9ritiers auront qualit\xe9 pour prendre connaissance de vos directives \xe0 votre d\xe9c\xe8s et nous demander leur mise en \u0153uvre.\n\nVous pouvez modifier ou r\xe9voquer vos directives \xe0 tout moment, en nous \xe9crivant aux coordonn\xe9es ci-dessus.\n\n#### 16. Portabilit\xe9 de vos donn\xe9es \xe0 caract\xe8re personnel\nVous disposez d\u2019un droit \xe0 la portabilit\xe9 des donn\xe9es \xe0 caract\xe8re personnel que vous nous aurez fournies, entendues comme les donn\xe9es que vous avez d\xe9clar\xe9es activement et consciemment dans le cadre de l\u2019acc\xe8s et de l\u2019utilisation des services, ainsi que des donn\xe9es g\xe9n\xe9r\xe9es par votre activit\xe9 dans le cadre de l\u2019utilisation des services. Nous vous rappelons que ce droit ne porte pas sur les donn\xe9es collect\xe9es et trait\xe9es sur une autre base l\xe9gale que le consentement ou l\u2019ex\xe9cution du contrat nous liant.\n\nCe droit peut \xeatre exerc\xe9 gratuitement, \xe0 tout moment, et notamment lors de la fermeture de votre compte sur le SIte, afin de r\xe9cup\xe9rer et de conserver vos donn\xe9es \xe0 caract\xe8re personnel.\n\nDans ce cadre, nous vous adresserons vos donn\xe9es \xe0 caract\xe8re personnel, par tous moyens jug\xe9s utiles, dans un format ouvert standard couramment utilis\xe9 et lisible par machine, conform\xe9ment \xe0 l\u2019\xe9tat de l\u2019art.\n\n#### 17. Introduction d\u2019une r\xe9clamation devant une autorit\xe9 de contr\xf4le\n\nVous \xeates \xe9galement inform\xe9s que vous disposez du droit d\u2019introduire une r\xe9clamation aupr\xe8s d\u2019une autorit\xe9 de contr\xf4le comp\xe9tente, (la Commission Nationale Informatique et Libert\xe9s pour la France), dans l\u2019Etat membre dans lequel se trouve votre r\xe9sidence habituelle, votre lieu de travail ou le lieu o\xf9 la violation de vos droits aurait \xe9t\xe9 commise, si vous consid\xe9rez que le traitement de vos donn\xe9es \xe0 caract\xe8re personnel objet de la pr\xe9sente charte constitue une violation des textes applicables.\n\nCe recours pourra \xeatre exerc\xe9 sans pr\xe9judice de tout autre recours devant une juridiction administrative ou juridictionnelle. En effet, vous disposez \xe9galement d\u2019un droit \xe0 un recours administratif ou juridictionnel effectif si vous consid\xe9rez que traitement de vos donn\xe9es \xe0 caract\xe8re personnel objet de la pr\xe9sente charte constitue une violation des textes applicables.\n\n#### 18. Limitation du traitement\n\nVous avez le droit d\u2019obtenir la limitation du traitement de vos donn\xe9es personnelles, dans les cas suivants :\n\n-\tPendant la dur\xe9e de v\xe9rification que nous mettons en \u0153uvre, lorsque vous contestez l\u2019exactitude de vos donn\xe9es \xe0 caract\xe8re personnel,\n-\tLorsque le traitement de ces donn\xe9es est illicite, et que vous souhaitez limiter ce traitement plut\xf4t que supprimer vos donn\xe9es,\n-\tLorsque nous n\u2019avons plus besoin de vos donn\xe9es personnelles, mais que vous souhaitez leur conservation pour exercer vos droits,\n-\tPendant la p\xe9riode de v\xe9rification des motifs l\xe9gitimes, lorsque vous vous \xeates oppos\xe9s au traitement de vos donn\xe9es personnelles.\n\n#### 19. Modifications\n\nNous nous r\xe9servons le droit, \xe0 notre seule discr\xe9tion, de modifier \xe0 tout moment la pr\xe9sente charte, en totalit\xe9 ou en partie. Ces modifications entreront en vigueur \xe0 compter de la publication de la nouvelle charte. Votre utilisation du Site suite \xe0 l\u2019entr\xe9e en vigueur de ces modifications vaudra reconnaissance et acceptation de la nouvelle charte. A d\xe9faut et si cette nouvelle charte ne vous convient pas, vous ne devrez plus acc\xe9der au Site.\n#### 20.  Entr\xe9e en vigueur\nLa pr\xe9sente charte est entr\xe9e en vigueur le 6 juin 2019.\n"
